VALUES ('gen_random_uuid()', "1400", 6, 'Фитнес-центр ТalisMan предназначен для занятий общей физической и силовой подготовкой. Абонементы от 1400 рублей. Для вас: • новые тренажёры от мировых производителей; • разные виды групповых фитнес-программ; • персональные занятия с тренером; • видео- и аудиосопровождение тренировочного процесса; • современная система кондиционирования; • просторные раздевалки, удобные душевые, сауна (посещение которой бесплатно при покупке абонемента или разового занятия). Кардиозона тренажёрного зала включает в себя беговые дорожки, эллиптические тренажёры и велотренажёры.', 2, 56.50069556822746, 84.94162099999998, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/TalisMan/', 'TalisMan', 'https://vk.com/talisman_tomsk'),
('gen_random_uuid()', "3000", 6, 'Фитнес-клуб Super Gym («Супер Джим») на пр. Комсомольском, д. 14а и ул. Карташова, д. 60/1 приглашает на занятия фитнесом и в тренажерный зал. Это современный фитнес-клуб, оснащенный новым оборудованием и фитнес-программами, которые помогут вам достигать ваших целей в максимально сжатые сроки. Ваше здоровье — наш приоритет! Для этого мы уделяем особое внимание подготовке персонала и составлению тренировочных программ. А теплая и дружелюбная атмосфера помогает вам отдохнуть от суеты и почувствовать себя желанным и любимым гостем!', 0, 56.48389456824437, 84.982243, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/SuperDzhim/', 'Супер Джим', 'https://supergym-tomsk.ru/'),
('gen_random_uuid()', "1200", 6, 'Мы рады видеть вас в нашем клубе. Здесь мы поможем вам создать тело мечты. Что мы предлагаем: • индивидуальный подход к каждому клиенту; • отсутствие очередей; • тренеров с медицинским высшим образованием; • качественные тренажёры; • спортивное питание; • результат; • отличное настроение.', 3, 56.45962606827215, 84.9833744999999, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/LifeTimeFitness/', 'Life time fitness', ''),
('gen_random_uuid()', "", 6, 'Только персональные тренировки в удобное для вас время. Направления работы: • снижение веса (хит) «Минус два размера за 8 недель»; • набор мышечной массы; • оздоровительная физкультура; • пилатес на реформере — new; • беговые тренировки; • составление рациона питания; • общая физическая подготовка; • подготовка к сдаче норм ГТО; • тренировки для пенсионеров; • подарочные сертификаты; • криосауна*.', 0, 56.476548068255546, 84.95971299999997, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/OurHall/', 'Наш зал', 'https://ourgym.ru/'),
('gen_random_uuid()', "1300", 6, 'Большой спортивный комплекс с удобной парковкой, двумя бассейнами 25 и 10 метров, сауной для взрослых и детей, тренажерным залом, двумя фитнес-залами, залом для фехтования и спортивным залом для игры в мини-футбол, волейбол и баскетбол. Каждая раздевалка оборудована кабинками для личных вещей, душевыми и туалетами, в спортивном комплексе расположены сушилки для волос. На месте всегда находятся администраторы, медицинский персонал, квалифицированные тренеры и инструкторы, которые смогут оказать вам профессиональную помощь, при её необходимости.', 1, 56.5029, 85.018093, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Akvatika/', 'Акватика', 'https://xn--80aaag5ajd6d.xn--p1ai/'),
